import React from 'react'
import BookCard from './BookCard.js';

const BookList = (props) => {
    return (
        <div className="BookList__list">
            {
                props.books.map((book, i)=>{
                    return <BookCard />
                })
            }
        </div>
    )
}

export default BookList;
